package com.joinz.lesson4b;

public class Main {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int h = 3;
		int w = 5;
		
		for (int i = 1; i <= h; i++) {
			for (int j = 1; j <= w; j++) {
				System.out.print("*");
			}
			System.out.println();
		}
	}

}
